import React from "react";
import Card from "./Card";
import img1 from "../src/images/3.jpg";
import img2 from "../src/images/4.jpg";
import img3 from "../src/images/5.jpg";
import img6 from "../src/images/8.jpg";
import img4 from "../src/images/6.jpg";
import img5 from "../src/images/7.jpg";
const Services = () => {
  var cardtitle1 = "Portrait Photography";
  var cardtitle2 = "Product Photography";
  var cardtitle3 = "Wedding Photography";
  var cardtitle4 = "Jewellery Photography";
  var cardtitle5 = "Real Estate Photography";
  var cardtitle6 = "Creative Professional Photography";
  var content1 =
    "Contemporary portrait photography in a relaxed, less formal setting captures people naturally and being themselves. Perfect for business portraits, your new-born baby, or for the whole family, we will work with you to achieve that extra special portrait.";
  var content2 =
    "Creative product photography increases sales, simple as that. What makes us different is in our thinking, our skill, and the execution of the image. Our experienced product photographers can work with you ,and your design team, to really make your products shine.";
  var content3 =
    "To us great wedding photographs are the result of getting to know you, your venue, and exactly what makes the real you as a couple. Together we can plan how to best capture memories of your big day through either storytelling in a relaxed manner, or more formal photographs.";
  var content4 =
    "While a product shot on a plain background is important to be your main image, jewellery on a model can offer great insight to customers. The buyer can picture the size and how the jewellery would look on them better when they see it modeled on a real person, it is an excellent way to show the scale of your jewellery. Model shots can help the customer understand your brand, the look and feel and the target audience is portrayed better. But it should be kept in mind that the jewellery should be the focus of the image. The light should be hitting the jewellery directly rather than highlighting the model.";
  var content5 = "Real estate ";
  var content6 =
    "Outstanding images. Every time. Call us today and discuss your project with our photographers.";
  return (
    <>
      <div className="my-5">
        <h1 className="text-center">Our Services</h1>
      </div>
      <div className="container-fluid mb-5">
        <div className="row">
          <div className="col-10 mx-auto">
            <div className="row gy-4">
              <Card image={img1} cardtitle={cardtitle1} content={content1} />
              <Card image={img2} cardtitle={cardtitle2} content={content2} />
              <Card image={img3} cardtitle={cardtitle3} content={content3} />
              <Card image={img4} cardtitle={cardtitle4} content={content4} />
              <Card image={img5} cardtitle={cardtitle5} content={content5} />
              <Card image={img6} cardtitle={cardtitle6} content={content6} />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Services;
